    const gotologin = () => {

        document.location.href('/login')
 
    }
    return(
        <>
            <div>
            <img alt = "logo" src="../img/aupuh_logo.png" />
            <h3>어푸</h3>
            </div>
            <div id="login">
                <button>회원가입</button>
            </div>
            <div id="login">
                <button onClick={gotologin}>로그인</button>
            </div>
        </>        
        
    )
}

export default Main;
